import React from 'react';
import './Contact.css';
import yarifeImage from '../../assets/images/Fotos profesionales/5.png';

const Contact = () => {
  const openWhatsApp = () => {
    const phone = '584242429016';
    const text = encodeURIComponent('Hola Yarife, quiero hablar contigo sobre mis proyectos.');
    window.open(`https://wa.me/${phone}?text=${text}`, '_blank');
  };

  const openEmail = () => {
    window.open('mailto:yarifepower@gmail.com', '_blank');
  };

  const openInstagram = () => {
    window.open('https://instagram.com/yarifepower', '_blank');
  };

  const openLinkedIn = () => {
    window.open('https://linkedin.com/in/yarife-vallenilla', '_blank');
  };

  const openYouTube = () => {
    window.open('https://youtube.com/@yarifepower', '_blank');
  };

  return (
    <section id="contacto" className="contact-section">
      {/* Sección Superior - Título y CTA */}
      <div className="contact-top">
        <div className="contact-top-content">
          <h1 className="contact-title">CONTACTAME</h1>
          <button onClick={openWhatsApp} className="contact-cta">
            QUIERO HABLAR CON YARIFE
          </button>
          <div className="contact-details">
            <div className="contact-detail">
              <span className="contact-label">Correo:</span>
              <span className="contact-value">yarifepower@gmail.com</span>
            </div>
            <div className="contact-detail">
              <span className="contact-label">Número de teléfono:</span>
              <span className="contact-value">+58 424 2429016</span>
            </div>
          </div>
        </div>
        
        {/* Flecha decorativa */}
        <div className="contact-arrow">
          <svg width="120" height="60" viewBox="0 0 120 60" fill="none">
            <path 
              d="M10 30 Q30 10 50 30 Q70 50 110 30" 
              stroke="var(--morado)" 
              strokeWidth="8" 
              fill="none"
              strokeLinecap="round"
            />
            <path 
              d="M100 25 L110 30 L100 35" 
              stroke="var(--morado)" 
              strokeWidth="8" 
              fill="none"
              strokeLinecap="round"
              strokeLinejoin="round"
            />
          </svg>
        </div>
      </div>

      {/* Sección Central - Foto de Yarife */}
      <div className="contact-center">
        <div className="yarife-photo-container">
          <img src={yarifeImage} alt="Yarife Vallenilla" className="yarife-photo" />
          <div className="photo-background"></div>
        </div>
      </div>

      {/* Sección Inferior - Logo y Redes Sociales */}
      <div className="contact-bottom">
        <div className="contact-bottom-content">
          <div className="yarife-logo">
            <span className="logo-text">YARIFE</span>
            <div className="logo-dot"></div>
          </div>
          
          <div className="social-media">
            <button onClick={openInstagram} className="social-icon instagram">
              <i className="fab fa-instagram"></i>
            </button>
            <button onClick={openYouTube} className="social-icon youtube">
              <i className="fab fa-youtube"></i>
            </button>
            <button onClick={openLinkedIn} className="social-icon linkedin">
              <i className="fab fa-linkedin-in"></i>
            </button>
            <button onClick={openWhatsApp} className="social-icon whatsapp">
              <i className="fab fa-whatsapp"></i>
            </button>
            <button className="social-icon tiktok">
              <i className="fab fa-tiktok"></i>
            </button>
          </div>
          
          <div className="copyright">
            Todos los derechos reservados
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
